MainEditorView::MainEditorView (BeatCounterAudioProcessor* ownerFilter, teragon::ConcurrentParameterSet& p, teragon::ResourceCache *r)
    : AudioProcessorEditor(ownerFilter),
      parameters(p),
      resources(r)
{
    addAndMakeVisible (beatIndicatorLight = new teragon::IndicatorLight (parameters,
                                                                         "Beat Triggered",
                                                                         resources));
    beatIndicatorLight->setName ("BeatIndicatorLight");

    addAndMakeVisible (hostTempoButton = new teragon::PushButton (parameters,
                                                                  "Use Host Tempo",
                                                                  resources));
    hostTempoButton->setName ("host tempo button");

    addAndMakeVisible (resetButton = new teragon::ToggleButton (parameters,
                                                                "Reset",
                                                                resources));
    resetButton->setName ("reset button");

    addAndMakeVisible (toleranceKnob = new teragon::ImageKnobLarge (parameters,
                                                                    "Tolerance",
                                                                    resources));
    toleranceKnob->setName ("tolerance knob");

    addAndMakeVisible (autofilterFrequencyKnob = new teragon::ImageKnobSmall (parameters,
                                                                              "Filter Frequency",
                                                                              resources));
    autofilterFrequencyKnob->setName ("autofilter frequency knob");

    addAndMakeVisible (autofilterButton = new teragon::PushButton (parameters,
                                                                   "Filter",
                                                                   resources));
    autofilterButton->setName ("enable autofilter");

    addAndMakeVisible (currentBpmLabel = new teragon::ParameterLabel (parameters,
                                                                      "Current BPM"));
    currentBpmLabel->setName ("current bpm label");

    addAndMakeVisible (runningBpmLabel = new teragon::ParameterLabel (parameters,
                                                                      "Running BPM"));
    runningBpmLabel->setName ("running bpm label");

    addAndMakeVisible (periodKnob = new teragon::ImageKnobLarge (parameters,
                                                                 "Period",
                                                                 resources));
    periodKnob->setName ("period knob");

    addAndMakeVisible (statusBar = new teragon::StatusBar (parameters,
                                                           resources));
    statusBar->setName ("status bar");

    addAndMakeVisible (versionLabel = new teragon::ParameterLabel (parameters,
                                                                   "Version"));
    versionLabel->setName ("version label");

    cachedImage_background_png = ImageCache::getFromMemory (background_png, background_pngSize);

    //[UserPreSize]
    //[/UserPreSize]

    setSize (581, 210);


    //[Constructor] You can add your own custom stuff here..
    statusBar->subscribeToParameters();
    statusBar->ignoreParameter("Current BPM");
    statusBar->ignoreParameter("Running BPM");
    statusBar->ignoreParameter("Beat Triggered");

    currentBpmLabel->setFont(Font(Font::getDefaultMonospacedFontName(), 16.0f, Font::plain));
    currentBpmLabel->setJustificationType(Justification::centredRight);
    runningBpmLabel->setFont(Font(Font::getDefaultMonospacedFontName(), 16.0f, Font::plain));
    runningBpmLabel->setJustificationType(Justification::centredRight);

    versionLabel->setFont(StatusBar::getFont());
    versionLabel->setJustificationType(Justification::centredRight);
    //[/Constructor]
}

